          text: {
            title: '3 bedroom apartment in the centre of Verbier',
            description:
              "A great opportunity to obtain a recently renovated 3 bedroom property a stones throw from the Medran ski lift.\r\n\r\nThe property is set across the first floor of the building, Pietra Setra, and has a lovely south facing aspect allowing lots of natural light into the apartment. It has been recently renovated to a modern style yet retains an alpine feel. The kitchen is open plan to the living room with a cosy fireplace. There is a master bedroom with ensuite bathroom, 2 further bedrooms and a second shower room.\r\n\r\nPietra Serena is located within just a hundred meters' walk of the Medran lift station. Place Blanche and Place Centrale are a 5-10 minute walk away.\r\n\r\nThe property comes with a rented parking space however the building is currently in talks with the commune to create a more permanent solution.\r\n\r\nThe apartment is available to be bought by foreigners and available as a secondary residence. \r\n\r\nThe famous ski resort of Verbier is located in the 4 valleys, the largest ski area in Switzerland. It includes the resorts of Verbier, Bruson, La Tzoumaz, Nendaz, Veysonnaz and Thyon, It boasts an extensive lift system connecting all the valleys together for 412km of slope skiing and endless off-piste. Its vast terrain is varied and interesting - providing endless days of skiing for every level. The resort buzzes with a multitude of restaurants bars and the well renowned après-ski.\r\nVerbier, Le Châble and their surroundings are an exciting place to be with a huge number of activities &amp; options for exploring the mountains all year round. From high-energy, adrenaline sports to relaxed ambles in the beautiful Alpine scenery, the Val de Bagnes has it all.\r\n\r\n161 km to Geneva Airport\r\n54 km to Sion Airport\r\n27 km to Martigny",
          },
