            description:
              "Realize-immo vous propose : proche de Verbier, dans un authentique petit village de la commune du Val de Bagnes, air pur et calme absolu, à 10 mn du Châble pour les remontées mécaniques sur Verbier ou à 7 km par la route du Soleil en été, rare sur le marché, 2 chalets à rénover, 1 chalet de 130 m2 + combles + sous-sol ( belle cave voûtée), à terminer de rénover et 1 mazot-grenier avec possibilité de construction sur 2 à 3 niveaux pour 60 à 90 m2.  Unique, en plein coeur du village, 4-5 places de parc extérieures.Vente en résidence secondaire autorisée pour les Suisses et les étrangers avec permis B/C ou forfait fiscal.Verbier, Val de Bagne : Bagnes est une ancienne commune suisse du canton du Valais située dans le district d'Entremont et qui englobe plusieurs villages dont Le Châble, Verbier et Bruson.Verbier, station valaisanne été-hiver renommée (ensoleillement maximal et ski jusqu'à mi-avril) fait partie du domaine des 4 Vallées, le plus grand domaine skiable de Suisse (410 km de pistes), qui permet de rejoindre les stations de Nendaz, Veysonnaz et Thyon.. Mecque du freeride de par son terrain de jeu incroyable, l'Xtrême de Verbier voit régulièrement défiler les ski bums du monde entier qui viennent ici comme ils se doivent de venir à Jackson Hole ou La Grave dans leur vie de skieur. Station mythique et domaine hors-piste incroyable., l'alliance du ski et de la fête, l'héliski y est autorisé, sentier raquettes et, en été, superbes randonnées et tracés pour le mountain bike.Liaison directe depuis le Châble avec parking gratuit et à 10 mn des chalets !Description détaillée les 2 biens datant de 1851, rare, authentique, en plein coeur du vieux-village ? ils sont les 2 à rénover, les demandes d'autorisation sont validées et des plans sont à disposition.Chalet avec possibilité d'aménager un grand appartement et un studio indépendant2 niveaux pour 130 m2 + combles aménageables + sous-sol avec une grande cave voûtée pouvant faire office également de carnotzetGrande terrasse avec soleil du matin jusque dans l'après-midi et balcon plein sudMazot-grenierlogement indépendant pouvant être construit sur 2 à 3 niveaux pour 60 à 90 m2.Parking (unique en plein coeur du village !)4-5 places de parc extérieuresN.b. : à 10 mn du Châble, parking gratuit et remontées mécaniques pour Verbier. A 7 km de Verbier par la route du Soleil (fermée en hiver). Arrêt de bus en bas du village pour le ChâbleCommerce d'alimentation dans le village.Disponible : de suiteLa note Realize-Immo : vous souhaitez profiter du grandiose domaine skiable de Verbier et des 4 vallées, tout en passant vos week-ends, vos vacances cozy, dans un cadre des plus authentiques, rare sur le marché, en plein coeur d'un vieux village valaisan, dans un calme et un ensoleillement maximal ressourçants, avec la possibilité de rénover à votre goût, ou encore d'y habiter à l'année tout en ayant une habitation et un studio pour vos invités ou à mettre en location, au prix de vente plus qu'abordable pour la région, car situé dans un village du Val de Bagne, hors de la foule de la station et malgré tout à seulement 10 mn du départ des remontées mécaniques au Châble pour Verbier.Une visite s'impose !Visite:Ariane DERIVAZ_+41 (0)79 770 48 99_",
