              "Lot de 2 chalets à transformer, situé dans le hameau des des Vernays, à Fontenelle-dessus, à quelques minutes des remontées mécaniques du Châble et de Verbier. Bâti en madriers anciens à l'extérieur et matériaux nobles, ces bâtisses d'antan sauront séduire les amateurs d'authenticite et de tradition valaisanne. Construit dans un écrin de verdure, à l'écart de toutes nuisances, ces chalets sont orientes plein sud. Leur situation est idéale avec le soleil dès le matin, la vue imprenable sur les montagnes, la proximité de la nature tout en restant proche de la plaine et de ses commodités. Il offre un bel espace de vie pour une famille, que ce soit pour y vivre à l'année ou en tant que résidence secondaire. Ce lot est composé ainsi : Grange « Mont Fort » en vieux madriers de 120 m2 prévue pour une habitation comprenant 2 niveaux, 1 cave et 1 garage. Plans à disposition.Chalet « Mont Gelé »  de 4.5 pces de 149 m2 habitables + 23 m2 de surface utile composé ainsi : Rez-de-chaussée :<ul><li>Studio indépendant avec entrée indépendante</li><li>Cave</li><li>Local technique </li></ul>Etage :<ul><li>Grand espace commun avec séjour/salle à manger/cuisine avec accès au balcon</li><li>Espace cuisine entièrement agencée et équipée</li><li>WC visiteur</li><li>Balcon orienté sud </li></ul>Combles :<ul><li>Belle chambre à coucher avec salle d'eau privative avec douche, WC et lavabo</li><li>Belle chambre à coucher avec salle d'eau privative avec baignoire, WC et lavabo</li><li>Balcon orienté sud</li></ul>Mezzanine : permet le couchage de 3 personnes Annexes :<ul><li>2 Raccards/grenier typique servant au rangement</li><li>Espace jardin</li><li>Espace pelouse</li><li>Terrasses</li><li>Place de parc couverte à disposition </li></ul>Remarques :<ul><li>Couverture en ardoise</li><li>Soubassement en pierres sèches</li><li>Vieux madriers</li><li>Chénaux en bois</li><li>Ferblanterie en cuivre</li><li>Cheminée en pierre avec poutre d'origine</li><li>Poutres apparentes vieux bois au plafond</li><li>Fenêtres avec croisillons</li><li>Sol en dalles du pays</li><li>Fontaine en granit rose du pays</li></ul> Surfaces :<ul><li>Surface habitable : 149 m2</li><li>Surface utile : 23 m2</li><li>Surface totale : 172 m2 </li></ul>Ce chalet nécessite des rafraichissements et quelques travaux de remise en état des installations courantes. Possibilité également d'acquérir un chalet voisin, voir bien 8564. Situation : <ul><li>Val de Bagnes, à 5 minutes du Châble et 10 minutes de Verbier</li><li>Altitude : 1060 m</li><li>Environnement calme en plaine nature</li><li>Vue imprenable et très bon ensoleillement </li></ul>Verbier se situe à 1500 m d'altitude, en Valais francophone, au coeur de la superbe chaine des Alpes. Le haut plateau de Verbier bénéficie d'un ensoleillement exceptionnel de par son orientation sud-ouest. Verbier offre un dépaysement enchanteur été comme hiver et une multitude d'activités sportives et culturelles. Séduit ? N'hésitez plus ! Appelez-moi pour une visite...",
