            title: 'CHALET SUR PARCELLE 16634 A MEDIERES',
            description:
              "Descriptif généralC'est à Médières, à 2 kilomètres en dessous de Verbier, que se trouve ce chalet de 2 appartements. Construit en 1930 et agrandit en 1956, il est situé en grande partie en zone à bâtir \"village\" . Une partie (environ 101 m2) côté aval du terrain est située hors zone à bâtir. L’appartement de 3 pièces d’environ 100 m2 en duplex bénéficie d’une très belle vue et d’un excellent ensoleillement.  Il se décrit comme suit: Spus-sol : une cave comprenant le local technique (chauffe-eau de 200 litres), chaudière de 2018, citerne à mazout de 4000 litres. Une cave en terre battue. Rez-supérieur : entrée, salon avec fourneau en pierres ollaires, cuisine séparée, une salle de bains &amp; wc, un réduit, une grande terrasse sud. Etage : 2 grandes chambres sud, avec balcon sud, un wc &amp; lavabo &amp; bidet. Hauteur sous plafond : 2.39 mètres. Combles : un galetas (170 cm au plus haut) accessible par une échelle escamotable. L'appartement de 2 pièces de 51m2, situé au rez-inférieur, sous la terrasse, a été remis à neuf en 1989. Il est composé d'une entrée, d'un salon, d'une cuisine séparée, d'une chambre, d'un réduit, ainsi que d'une salle de bains &amp; wc. Le chauffage est électrique.   Possibilité de garer 2 voitures. Ce bien ne peut être acquis que par une personne de nationalité suisse ou résidant en Suisse au bénéfice d'un permis de séjour de type B ou C.     Descriptif 2Chalet à Médières de 2 appartements Grand 3 pièces + 2 pièces A rénover",
