            description:
              "Descriptif généralAppartement de 4 pièces de haut standing aux combles dans un magnifique chalet en pierres et vieux bois, charpente avec poutres anciennes et toiture en ardoise. De conception écologique le chalet répond aux normes du label MINERGIE. Il est connecté au chauffage à distance à pellets (CAD), dispose d’un système de ventilation et d’humidification centralisé ainsi que d’un ascenseur. Le chalet se compose de surfaces commerciales au rez-de-chaussée et de 2 appartements dans les étages. Il jouit d’une situation idéale en plein centre de la station à proximité de toutes les commodités (transports publics, commerces, restaurants, bars, etc.). Exposé au sud, jouissant d’un ensoleillement optimal et d’une jolie vue, l’appartement des combles se décrit comme suit : Hall d’entrée, séjour spacieux avec cheminée, beaux volumes, baies vitrées, cuisine ouverte en U et espace repas. Une chambre double au sud avec salle de bain/wc privative en suite et accès balcon. Une chambre double avec salle de douche/wc privative en suite. Une chambre double avec accès balcon au nord. Une salle de douche/wc. Un grand balcon au sud et un petit balcon au nord. L’appartement est vendu avec une place de parc intérieure privée dans le garage Square-Poste, ainsi qu’une cave/buanderie/local à skis privée. Finitions intérieures au gré de l'acquéreur. Descriptif 2Magnifique appartement neuf de 4 pièces Au coeur de la station A proximité de toutes commodités",
