              "Situé à proximité du départ des télécabines de Médran, ce majestueux chalet exposé plein sud, vous offre une vue imprenable sur les montagnes du Val de Bagnes. Il est destiné à des résidents suisses ou à des personnes titulaires d'un permis B/C, en tant que résidence principale.Ce chalet a été construit en 2018 sur 5 niveaux avec des matériaux de qualité et noble, et se compose comme suit : D'un garage pour 4 voitures, d'un local à skis, d'une buanderie, d'un vestiaire avec toilettes visiteurs, d'un carnotzet avec cuisine et d'armoires à vin.À l'étage supérieur, un luxueux spa qui se compose d'un jacuzzi, une piscine intérieure, un sauna, un hammam, une douche avec WC séparé. Pour poursuivre, une salle de gym, une kitchenette avec une chambre froide et un grand espace de rangement. Pour finir en beauté, un large home cinéma pour passer une agréable soirée en famille.Le premier étage est accessible depuis l'extérieur. Il offre un vestiaire, un hall d'entrée, un spacieux séjour avec cheminée et bibliothèque murale. La salle à manger et la cuisine entièrement équipée sont une seule pièce ouverte avec le salon. Depuis cette même pièce, un accès au balcon et à la terrasse.Le deuxième étage se compose de 3 chambres à coucher. La première chambre double et sa salle de bain avec douche, balcon privée et TV. La deuxième est une autre chambre double avec balcon, TV et une salle de bain privée mais celle-ci avec douche et bain. La troisième chambre à coucher et une chambre aménagée pour les enfants avec 4 lits superposés, accès au balcon et une salle de bain privé avec douche. Au troisième étage, la suite parentale avec vue dégagée sur les montagnes et son balcon privé.À cette chambre s'ajoute une salle de bain avec baignoire et douche, un dressing et une cheminée.Une autre pièce qui peut faire office de chambrette ou de bureau.",
