          text: {
            title:
              'This charming property is perched amongst a cluster of chalets alongside the forest above Savoleyres',
            description:
              "Ideal for those seeking an authentic mountain home, this charming property is perched amongst a cluster of chalets alongside the forest above Savoleyres. \r\n\r\nFinished in natural stone and wood, it offers 2 comfortable living spaces and 3 bedrooms. The stunning panoramic views of the mountains and village are breathtaking. \r\n\r\nThe road to the chalet is open to cars from spring to the first major snowfall.\r\n\r\nThe bright chalet is constructed on 3 levels, with the main entrance supplying a cloak and ski room.\r\n\r\nOpening under the double height ceiling, a mezzanine has been organized into a TV corner and office.\r\n\r\nDescending the stairs the airy and spacious living room with a open plan living, stone surround fireplace and kitchen completes the room. A wrap-around balcony and patio are directly accessible from all sides.\r\n\r\nThe three bedrooms are located on the garden level. A large master bedroom with private bathroom offers lovely views and direct access to the garden. There is a second double bedroom\r\nwith similar views as well as a bunk bedroom and a shared bathroom and separate WC.\r\n\r\nThe chalet has a laundry room and guest WC. A separate storage room is located beside the entrance.\r\n\r\nIt is possible to park just above the chalet, along the roadside, that receives snow removal.\r\n\r\nNewly equipped with a closed 3-seater Traxter HD8 Pro Vert, it makes winter access to the chalet simple and fun. \r\n\r\nThis chalet is available to Swiss or Permit Holders.\r\n\r\n\r\n\r\nAdditional Information:\r\n\r\nOne of the world's most popular ski destinations, the renowned Alpine resort of Verbier is situated less than 2 hours from Geneva. The resort has become synonymous with high altitude on and off-piste skiing, its party atmosphere and year round sporting activities and cultural events. \r\n\r\nFrom its sunny plateau at 1500m, Verbier offers breath-taking views of the Combin Massif and access to the towering heights of Mont Fort. The centre of the resort pulsates with life and there are a wealth of shops, hotels, restaurants, bars and nightclubs to frequent. In winter, Verbier forms the nucleus of the Four Valleys which is the largest ski area in Switzerland. With the recent completion of the W Hotel, Residence Alex and Rosalp with an exciting new restaurant planned this season, Verbier is constantly re-inventing itself to keep the offering current.",
          },
